import React from 'react';
import { Link } from 'react-router-dom';

export default function Navbar() {

  return (
  <div className="Navbar">
    <nav>
      <ul>
        <li><Link to="/">Home</Link></li>
        <li><Link to="/team">Team</Link></li>
        <li><Link to="https://github.com/">Github</Link></li>
      </ul>
    </nav>
  </div>
  )
}
